import "./App.css";
import denverpic from "./assets/img/Denver.jpeg";

function App() {
  return (
    <div className="App">
      <div className="headercontainer">
        <h1> Denver Open Jam</h1>
        <img className="mainpic" src={denverpic}></img>
      </div>
    </div>
  );
}

export default App;
